  \"swfsc-mmtd-etp-chase-encirclement-stress-studies-chess-2001\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The CHase Encirclement Stress Studies (CHESS)
  are part of a comprehensive research program designed to investigate the status
  of dolphin stocks that are involved in tuna purse seine fishing operations in the
  eastern tropical Pacific Ocean (ETP). The tuna industry has used the association
  between tuna and dolphins to fish in the ETP for over five decades, and stocks of
  spotted dolphins (Stenella attenuata) and spinner dolphins (Stenella longirostris)
  were depleted by high historical levels of mortality in tuna purse-seine nets. While
  changes in the fishery during the last three decades have greatly reduced the observed
  mortality of dolphins, there continues to be concern that the fishing methods used
  may be causing stress and having a negative impact on dolphin population recovery.nnThe
  Chase Encirclement Stress Studies involved the use of a research vessel and a chartered
  tuna fishing vessel during August-October 2001 to repeatedly capture and release
  individual dolphins and collected biological samples for evaluating stress. The
  research program incorporated several complementary research projects that addressed
  different ways in which chase and capture stress may manifest itself in individual
  dolphins involved in tuna purse seine operations. Research techniques for evaluating
  stress included a) analyses of single and repeat blood samples, b) molecular analyses
  of chronic stress from skin samples, c) measurement of dolphin surface and body
  temperatures to investigate heat stress, d) satellite tagging and tracking, e) documentation
  of reproductive status and, if it occurred, cow/calf separation between successive
  chases, and f) behavior studies.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
